Thanks for the quick response! Do you mean inconsistencies in their outputs? The `then_branch` and `else_branch` both have one output:

```console
# Output of then_branch.
output {
  name: "sub_graph_ending_node_Identity__109:0"
  type {
    tensor_type {
      elem_type: 6
      shape {
        dim {
          dim_param: "unk__5136"
        }
      }
    }
  }
}

# Output of else_branch.
output {
  name: "sub_graph_ending_node_Identity__110:0"
  type {
    tensor_type {
      elem_type: 6
      shape {
        dim {
          dim_param: "unk__5137"
        }
      }
    }
  }
}
```

The two outputs are the same except for the dynamic shapes and the names.
